import React from 'react';
import { BrowserRouter, Route, Link } from 'react-router-dom';

const PageOne = () => {
    return (
        <div>
            PageOne
            <button><Link to="/pagetwo">Me clica, irmão</Link></button>
        </div>
    );
}; 
const PageTwo = () => {
    return (
        <div>
            PageTwo
            <Link to="/">Me clica, irmão</Link>
        </div>
    );
}; 

const App = () => {
    return (
        <div>
            <BrowserRouter>
                <div>
                    <Route path="/" exact component={PageOne}/>
                    <Route path="/pagetwo" component={PageTwo}/>
                </div>
            </BrowserRouter>
        </div>
    );
};

export default App;
